window.bookSummaryJSON = "<p><b>From the creator of Valuetainment, the number-one YouTube channel for entrepreneurs, and “one of the most exciting thinkers” (Ray Dalio, author of </b><b><i>Principles</i></b><b>) in business today, comes a practical and effective guide for thinking more clearly and achieving your most audacious professional goals.</b></p> <p>Both successful entrepreneurs and chess grandmasters have the vision to look at the pieces in front of them and anticipate their next five moves. In this book, Patrick Bet-David “helps entrepreneurs understand exactly what they need to do next” (Brian Tracy, author of<i> Eat That Frog!</i>) by translating this skill into a valuable methodology. Whether you feel like you’ve hit a wall, lost your fire, or are looking for innovative strategies to take your business to the next level, <i>Your Next Five Moves</i> has the answers.</p> <p>You will gain:<br> <b>CLARITY</b> on what you want and who you want to be.<br> <b>STRATEGY</b> to help you reason in the war room and the board room.<br> <b>GROWTH TACTICS</b> for good times and bad.<br> <b>SKILLS</b> for building the right team based on strong values.<br> <b>INSIGHT</b> on power plays and the art of applying leverage.</p> <p>Combining these principles and revelations drawn from Patrick’s own rise to successful CEO, <i>Your Next Five Moves </i>is a must-listenfor any serious executive, strategist, or entrepreneur.</p>"; 
